import { BrowserRouter, Routes, Route } from 'react-router-dom'
import Layout from './pages/Layout'
import { Button } from 'antd'
import Login from '@/pages/Login'  //Âà´ÂêçË∑ØÂæÑÁöÑÊñπÂºè
// import Login from './pages/Login'  //‰º†ÁªüÁöÑÂØºÂÖ•ÊñπÂºè
import { AuthComponents } from '@/components/AuthComponents'


function App ()
{
	return (
		//Ë∑ØÁî±ÈÖçÁΩÆÔºàÂåÖË£πÔºâ
		<BrowserRouter>
			<div className="App">
				<Button type="primary">Primary Button</Button>
				{/* Ë∑ØÁî±Âá∫Âè£ */}
				<Routes>
					{/* ÂàõÂª∫Ë∑ØÁî± path Ë∑üÁªÑ‰ª∂ÁöÑÂØπÂ∫îÂÖ≥Á≥ª, Ê≥®ÊÑèÔºåüî•üî•ËøôÈáå Layout ‰∏çËÉΩÂÜôÊ≠ªÔºÅË¶ÅÂåÖË£π <AuthComponents> Èâ¥ÊùÉÁúãÊòØÂê¶ÁôªÂΩï‰∫ÜÔºÅÔºÅ */}
					<Route path='/'       element={ <AuthComponents><Layout /></AuthComponents> }>  </Route>
					<Route path='/'       element={ <Layout />}>  </Route>
					<Route path='/login'  element={ <Login /> }>  </Route>
				</Routes>
			</div>
		</BrowserRouter>
	)
}

export default App
